import http from "./http";


const getAll = () => {
  return http.get("/movies");
};

const get = id => {
  return http.get(`/movies/${id}`);
};

const create = data => {
  return http.post("/movies", data);
};

const remove = id => {
  return http.delete(`/movies/${id}`);
};


const ApiService = {
  getAll,
  get,
  create,
  remove
};

export default ApiService;
